import { Button } from '@material-ui/core';
import React, { useState } from 'react';
import loginService from './../../services/login.service';
import identityService from './../../services/identity.service';

function Index() {
    const [identityContext] = useState(identityService.getIdentityContext);

    return (
        <div>
            Hello bok
            <Button onClick={() => {loginService.login("noviuser", "noviuser")}}>Login</Button>
            {identityContext ? "Hello " + identityContext.username + "!" : ""}
        </div>
    );
}

export default Index;
